import React from 'react';
import styles from './Produtos.module.css';
import foto from '././assets/maquina_escrever.jpg';

const Contato = () => {
  return (
    <section className={styles.contato}>
      <img src={foto} alt="Maquina de escrever" />
      <h1>Contato</h1>
    </section>
  );
};

export default Contato;
